import React from "react";
import $ from 'jquery';
import {Link} from 'react-router-dom';

document.addEventListener("DOMContentLoaded", function(event) {

    const showNavbar = (toggleId, navId, bodyId, headerId) =>{
    const toggle = document.getElementById(toggleId),
    nav = document.getElementById(navId),
    bodypd = document.getElementById(bodyId),
    headerpd = document.getElementById(headerId)

    if(toggle && nav && bodypd && headerpd){
    toggle.addEventListener('click', ()=>{
    nav.classList.toggle('show')
    toggle.classList.toggle('bx-x')
    bodypd.classList.toggle('body-pd')
    headerpd.classList.toggle('body-pd')
    })
    }
    }

    showNavbar('header-toggle','nav-bar','body-pd','header')

    const linkColor = document.querySelectorAll('.nav_link')

    function colorLink(){
    if(linkColor){
    linkColor.forEach(l=> l.classList.remove('active'))
    this.classList.add('active')
    }
    }
    linkColor.forEach(l=> l.addEventListener('click', colorLink))

    });

const Sidebar = () => {
    return(
   <div>
       <header className="header" id="header">
        <div className="header_toggle"><i id="header-toggle" className="fas fa-bars text-white"></i> </div>
        <div className="header_img"> </div>
    </header>
    <div className="l-navbar" id="nav-bar">
        <nav className="nav">
            <div> <Link href="#" className="nav_logo"><i className="fas fa-angry"></i> <span className="nav_logo-name">Example</span> </Link>
                <div className="nav_list"> <Link href="#" className="nav_link active"> <i className="fab fa-angellist"></i> <span className="nav_name">Dashboard</span> </Link> <Link href="#" className="nav_link"> <i className="fas fa-anchor"></i> <span className="nav_name">Stats</span> </Link> <Link className="nav_link nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false"> <i className="fas fa-award"></i> <span className="nav_name">Dropdown</span> </Link>
                    <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                        <li><Link className="dropdown-item" href="#">Action</Link></li>
                        <li><Link className="dropdown-item" href="#">Another action</Link></li>
                        <li>

                        </li>
                        <li><Link className="dropdown-item" href="#">Something else here</Link></li>
                    </ul>
                </div>
            </div> <Link href="#" className="nav_link"> <i className='bx bx-log-out nav_icon'></i> <span className="nav_name">SignOut</span> </Link>
        </nav>
    </div>

    <div className="height-100 bg-light">
        <h4>Content HERE</h4>
    </div>
   </div>

    );
}

export default Sidebar;
